Sacha Baron Cohen brings his Kazakh journalist character Borat Sagdiyev to the big screen for the first time. Leaving his native Kazakhstan, Borat travels to America to make a documentary. As he zigzags across the nation, Borat meets real people in real situations with hysterical conequences. His backwards behavior generates strong reactions around him exposing prejudices and hypocrisies in American culture.

